import './App.css';
import Navbar from './container/Navbar';
import NewsItem from './container/NewsItem';
import { BrowserRouter,Route,Routes } from 'react-router-dom';
import Technology from './container/Technology';
import Sports from './container/Sports';
import Entertainment from './container/Entertainment';

function App() {
  return (
     <>
     <BrowserRouter>
     <Navbar/>
      <Routes>
        <Route path='/' element={<NewsItem/>}></Route>
        <Route path='/business' element={<Technology/>}></Route>
        <Route path='/entertainment' element={<Sports/>}></Route>
        <Route path='/general' element={<Entertainment/>}></Route>
        <Route path='/sport' element={<NewsItem/>}></Route>
        <Route path='/technology' element={<NewsItem/>}></Route>
      </Routes>
     </BrowserRouter>
     </>
  );
}

export default App;
